We made a count of the species seen between September 1984 and July 1985. The common birds were;
Goldfinch Rook Blackbird Pied Wagtail Kestral Starling Canada Goose House Sparrow Gull Fieldfare Mistle Thrush Robin Woodpigeon Collared Dove Magpie Partridge Jackdaw Swift Chaffinch Mallard Duck Lapwing Pheasant House Martin Blue Tit Dunnock Song Thrush Great Tit Moorhen Green Finch Swallow
The less common birds were;_ Little Owl Yellow Wagtail Curlew Barn Owl Long Tailed Tit Swan Tawny Owl Tree Sparrow
